export interface SaleDeposit {
  new (
    targetRecipient: {
      paymentCredential:
        | { VerificationKeyCredential: [string] }
        | { ScriptCredential: [string] };
      stakeCredential:
        | {
            Inline: [
              | { VerificationKeyCredential: [string] }
              | { ScriptCredential: [string] },
            ];
          }
        | {
            Pointer: {
              slotNumber: bigint;
              transactionIndex: bigint;
              certificateIndex: bigint;
            };
          }
        | null;
    },
    adminPol: string,
    adminTn: string,
  ): Validator;
  redeemer:
    | {
        DepositRedeemer: {
          lovelaceSent: bigint;
          adminOref: { transactionId: { hash: string }; outputIndex: bigint };
        };
      }
    | {
        CollectRedeemer: {
          adminOref: { transactionId: { hash: string }; outputIndex: bigint };
          outputIdx: bigint;
          claimTotal: bigint;
          details: {
            totalExpectedAda: bigint;
            priceN: bigint;
            priceD: bigint;
            mintTokenPol: string;
            mintTokenTn: string;
            expiryTime: bigint;
          };
        };
      }
    | "ExpiryRedeemer";
}

